import React from 'react';
import Lettering from '../components/lettering';
import Slide from '../components/slide';
import './slider.css';

export const foo = 'baa';

export const media = [
  {
    slug: '',
    backgroundColor: 'red',
    className: 'slide page-one',
    children: (
      <Slide>
        <Lettering title="INDEX.JS" />
      </Slide>
    ),
  },
  {
    slug: 'page-two',
    className: 'slide page-two',
    children: <Lettering title="PAGE-TWO.JS" />,
  },
  {
    slug: 'page-three',
    className: 'slide page-three',
    children: (
      <Lettering
        text={[
          '[PAGE THREE] This is the first line of text',
          'This is the second line of thext',
          'This is the third line of text',
        ]}
      />
    ),
  },
];
